import React from 'react';
var Ons = require('onsenui');
var ROns = require('react-onsenui');

class TabPage extends React.Component {
  pushPage() {
    this.props.navigator.pushPage({
      component: SecondPage
    });
  }
  

  render() {
    return (
      <ROns.Page>
        <ROns.Toolbar>
          <div className="center">{this.props.title}</div>
        </ROns.Toolbar>

        <p style={{'text-align' : 'center'}}>
          <ROns.Button onClick={this.pushPage.bind(this)}>Push page</ROns.Button>
        </p>
      </ROns.Page>
    );
  }
}

class SecondPage extends React.Component {
  pushPage() {
    this.props.navigator.pushPage({component: SecondPage});
  }

  popPage() {
    this.props.navigator.popPage();
  }

  render() {
    return (
      <ROns.Page>
        <ROns.Toolbar>
          <div className="left"><ROns.BackButton>Back</ROns.BackButton></div>
          <div className="center">Another page</div>
        </ROns.Toolbar>

        <p style={{textAlign: 'center'}}>
          <ROns.Button onClick={this.pushPage.bind(this)}>Push page</ROns.Button>
          <ROns.Button onClick={this.popPage.bind(this)}>Pop page</ROns.Button>
        </p>
      </ROns.Page>
    );
  }
}


class TabBar extends React.Component{
   
    renderTabs() {
        const sections = new Map();
        sections.set('main', 'главная');
        sections.set('categories' , 'категории');
        sections.set('auth', 'авторизация');
          
    
        return Array.from(sections.keys()).map((key) => {
          return {
            content: <TabPage key={key} title={sections.get(key)} />,
            tab: <ROns.Tab key={key} label={sections.get(key)} />
          };
        });
      }
    
      render() {
        return (
          <ROns.Tabbar
            initialIndex={0}
            renderTabs={this.renderTabs}
          />
        );
      }
}


export default TabBar;
